  [],\n\t\"revision_timestamp\": \"2016-03-21T21:17:55.393856\",\n\t\"name\": \"physical-elwha-river-dam-removal-study\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study examines the ecosystem response
  of the Elwha River to the removal of the Elwha River dams. We will measure the following
  attributes of ecosystem response:nn1. Biological (primary and secondary productivity,
  juvenile and adult fish)n2. Physical (particle size distribution, habitat type,
  and habitat condition)n3. Chemical (nutrients and stable isotopes).nnThis is part
  of a larger effort that includes NOAA, US Fish and Wildlife Service, USGS, Lower
  Elwha Tribe, WDFW, and NPS. Specific work includes drift samples, benthic samples,
  juvenile snorkel surveys, juvenile mark-recapture surveys, habitat surveys, pebble
  counts, longitudinal profiles, turbidity measurements, adult spawner surveys, and
  juvenile fish diet samples using gastric lavage. Products include several annual
  reports and published papers, future journal papers, and a database. The management
  audience includes those involved in salmon restoration projects, salmon habitat
  monitoring, NOAA's Open Rivers Initiative, and NOAA's Restoration Center. This is
  an ongoing project that compliments several other projects, and there is no firm
  deadline.nnAll relevant physical data.\",\n\t\"license_title\": null,\n\t\"extras\":
